import React from "react";
import { NavLink } from "react-router-dom";
import { MenuItems } from "./style";
const MenuItem = ({menuItem, type}) => {
  const {name, path, icon}  = menuItem;
  return(
    <MenuItems className="menu-item" type={type}>
      <NavLink to={path} exact className="menu-link" activeClassName="active">
        {icon}
        {name}
      </NavLink>
    </MenuItems>
  );
}
export default MenuItem;
